import React from 'react';

const Country = ({ country }) => {
  return (
    console.log(country),
    (
      <div className='card'>
        <div className='row'>
          <div className='col-md-6'>
            <img
              className='card-img-top img-fluid p-3'
              src={country.flag}
              alt={country.name}
            />
            <h1>{country.name}</h1>
          </div>
          <div className='col-md-6'></div>
        </div>
      </div>
    )
  );
};

export default Country;
